import React from 'react';
import Card from './Card'
import '../styles/body.css';
import logo from '../images/logo.svg';

class Body extends React.Component {
    render() {
        return (
            <div className="body">
            <div className="body_container">
                <Card image={logo}/>
                <Card />
                <Card />
                <Card image={logo}/>
                </div>
            </div>
        )

    }
}

export default Body
